import React from 'react';
import profilePic from '../path/to/your/Profile.jpg'; // Adjust the path to your image

const Introduction = () => (
  <div className="container text-center">
    <img src={profilePic} alt="Profile" className="img-fluid rounded-circle" style={{ width: '150px', height: '150px' }} />
    <h1>Introduction</h1>
    <p>Hi, I'm Ahmed Afraz. I'm a software engineering student at Air University. My ambition is to become a skilled full-stack developer.</p>
  </div>
);

export default Introduction;
